#include "mod.h"

/**
* Definition for binary tree with next pointer.
* struct TreeLinkNode {
*  int val;
*  TreeLinkNode *left, *right, *next;
*  TreeLinkNode(int x) : val(x), left(NULL), right(NULL), next(NULL) {}
* };
*/
class Solution {
public:
	bool buddyStrings(string A, string B) {
		if (A.size() != B.size() || A.size() <= 1)return false;
		int diff_idx = -1;
		for (int i = 0; i<A.size(); ++i) {
			if (A[i] == B[i])continue;
			if (diff_idx == -1)diff_idx = i;
			else {
				swap(A[diff_idx], A[i]);
				break;
			}
		}
		if (diff_idx != -1){
            if(A==B)return true;
            else return false;
        }
		else {
			for (int i = 0; i<A.size(); ++i) {
				for (int j = i + 1; j<A.size(); ++j) {
					if ((A[i] == A[j])&&( B[i] == B[j])&&(A[i]==B[i])) {
						return true;
					}
				}
			}
		}
		return false;
	}
};


int main() {
	string s1="";
	string s2="";
	Solution test;
	cout << test.buddyStrings(s1, s2) << endl;
	return 0;
}